import React from "react";
import { Button } from "@mui/material";

const StyledButton = (props) => (
  <Button disableRipple={true} sx={{ background: "transparent" }}>
    {props.children}
  </Button>
);

export default function AboutPageButton(name) {
  return (
    <>
      <StyledButton>{name}</StyledButton>
    </>
  );
}
